import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import ProtectedRoute from './components/common/ProtectedRoute';
import LoadingSpinner from './components/common/LoadingSpinner';
import Navbar from './components/common/Navbar';

// Auth Components
import Login from './components/auth/Login';
import Register from './components/auth/Register';

// Admin Components
import AdminDashboard from './components/admin/AdminDashboard';
import UserManagement from './components/admin/UserManagement';
import SystemAnalytics from './components/admin/SystemAnalytics';
import AuditLogs from './components/admin/AuditLogs';

// Professor Components
import ProfessorDashboard from './components/professor/ProfessorDashboard';
import ClassManagement from './components/professor/ClassManagement';
import QuizManagement from './components/professor/QuizManagement';
import QuizCreator from './components/professor/QuizCreator';
import QuizResults from './components/professor/QuizResults';

// Student Components
import StudentDashboard from './components/student/StudentDashboard';
import AvailableQuizzes from './components/student/AvailableQuizzes';
import TakeQuiz from './components/student/TakeQuiz';
import QuizHistory from './components/student/QuizHistory';

// CSS
import './App.css';

function App() {
    return (
        <AuthProvider>
            <Router>
                <div className="App">
                    <Navbar />
                    <Routes>
                        {/* Public Routes */}
                        <Route path="/login" element={<Login />} />
                        <Route path="/register" element={<Register />} />

                        {/* Default redirect */}
                        <Route path="/" element={<Navigate to="/login" replace />} />

                        {/* Admin Routes */}
                        <Route
                            path="/admin/dashboard"
                            element={
                                <ProtectedRoute requiredRole="admin">
                                    <AdminDashboard />
                                </ProtectedRoute>
                            }
                        />
                        <Route
                            path="/admin/users"
                            element={
                                <ProtectedRoute requiredRole="admin">
                                    <UserManagement />
                                </ProtectedRoute>
                            }
                        />
                        <Route
                            path="/admin/analytics"
                            element={
                                <ProtectedRoute requiredRole="admin">
                                    <SystemAnalytics />
                                </ProtectedRoute>
                            }
                        />
                        <Route
                            path="/admin/audit"
                            element={
                                <ProtectedRoute requiredRole="admin">
                                    <AuditLogs />
                                </ProtectedRoute>
                            }
                        />

                        {/* Professor Routes */}
                        <Route
                            path="/professor/dashboard"
                            element={
                                <ProtectedRoute requiredRole="professor">
                                    <ProfessorDashboard />
                                </ProtectedRoute>
                            }
                        />
                        <Route
                            path="/professor/classes"
                            element={
                                <ProtectedRoute requiredRole="professor">
                                    <ClassManagement />
                                </ProtectedRoute>
                            }
                        />
                        <Route
                            path="/professor/quizzes"
                            element={
                                <ProtectedRoute requiredRole="professor">
                                    <QuizManagement />
                                </ProtectedRoute>
                            }
                        />
                        <Route
                            path="/professor/quiz/create"
                            element={
                                <ProtectedRoute requiredRole="professor">
                                    <QuizCreator />
                                </ProtectedRoute>
                            }
                        />
                        <Route
                            path="/professor/quiz/edit/:id"
                            element={
                                <ProtectedRoute requiredRole="professor">
                                    <QuizCreator />
                                </ProtectedRoute>
                            }
                        />
                        <Route
                            path="/professor/quiz/results/:id"
                            element={
                                <ProtectedRoute requiredRole="professor">
                                    <QuizResults />
                                </ProtectedRoute>
                            }
                        />

                        {/* Student Routes */}
                        <Route
                            path="/student/dashboard"
                            element={
                                <ProtectedRoute requiredRole="student">
                                    <StudentDashboard />
                                </ProtectedRoute>
                            }
                        />
                        <Route
                            path="/student/quizzes"
                            element={
                                <ProtectedRoute requiredRole="student">
                                    <AvailableQuizzes />
                                </ProtectedRoute>
                            }
                        />
                        <Route
                            path="/student/quiz/take/:id"
                            element={
                                <ProtectedRoute requiredRole="student">
                                    <TakeQuiz />
                                </ProtectedRoute>
                            }
                        />
                        <Route
                            path="/student/history"
                            element={
                                <ProtectedRoute requiredRole="student">
                                    <QuizHistory />
                                </ProtectedRoute>
                            }
                        />

                        {/* Catch all - redirect to login */}
                        <Route path="*" element={<Navigate to="/login" replace />} />
                    </Routes>
                </div>
            </Router>
        </AuthProvider>
    );
}

export default App;
